import type { FC } from "react";

import styles from "./Container.module.scss";
import TodoInsert from "./todoInsert";
import TodoData from "./todoData";
import { createContext, useState } from "react";
import { ITodoData } from "./types";

export const MyContextData = createContext({});

const Container: FC = () => {
  const [data, setData] = useState<ITodoData[]>([
    {
      id: 1,
      name: "gag",
      age: 23,
      subscription: "subscription",
      employment: "Employment",
    },
  ]);
  const list = {
    data: data,
    setData: setData,
  };
  return (
    <div className={styles.wrapper}>
      <div className={styles.wrapper__container}>
        <MyContextData.Provider value={list}>
          <div className={styles.wrapper__container__insert}>
            <TodoInsert />
          </div>
          <div className={styles.wrapper__container__data}>
            <TodoData />
          </div>
        </MyContextData.Provider>
      </div>
    </div>
  );
};
export default Container;
